import { AiOutlineUser } from 'react-icons/ai';
import { FiShoppingCart } from 'react-icons/fi';
import ReactSVG from 'react-svg';
const mobileMenus = [
  {
    icon: <ReactSVG src="" />,
    action: 'input',
    input: {
      type: 'text',
      action: 'seach',
    },
  },
  {
    label: 'Explore',
    link: '/products',
    action: 'link',

    subMenus: [
      {
        label: 'MissValentine Bra',
        link: '/category/?cid=topicals',
        action: 'link',
        as: '/category/topicals',
      },
      {
        label: 'MissValentine Panty',
        link: '/category/?cid=pets',
        action: 'link',
        as: '/category/pets',
      },
    ],
  },
  {
    label: 'Learn',
    link: '/learn',
    action: 'link',
  },
  {
    label: 'Consult',
    link: '/consult',
    action: 'link',
  },
  {
    label: 'Account',
    link: '/account',
    onlyLogin: true,
  },
  {
    label: 'Logout',
    action: 'logout',
    onlyLogin: true,
  },
  {
    label: 'Login',
    // icon: <AiOutlineUser />,
    action: 'reg',
    onlyLogin: false,
  },
  // {
  //     icon: <FiShoppingCart />,
  //     action: "cart"
  // },
];
export default mobileMenus;
